void matrix_mul::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state9.read())) {
        bitNumber_assign_reg_203 = i_reg_897.read();
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && 
                esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
        bitNumber_assign_reg_203 = ap_const_lv8_0;
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state7.read())) {
        i_0_i_reg_236 = i_3_reg_943.read();
    } else if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state5.read())) {
        i_0_i_reg_236 = ap_const_lv3_1;
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state4.read())) {
        j_0_reg_215 = j_reg_910.read();
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read()) && 
                esl_seteq<1,1,1>(icmp_ln124_fu_262_p2.read(), ap_const_lv1_0))) {
        j_0_reg_215 = ap_const_lv3_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read()) && 
         esl_seteq<1,1,1>(icmp_ln124_fu_262_p2.read(), ap_const_lv1_1))) {
        loop_0_reg_247 = ap_const_lv3_0;
    } else if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state11.read())) {
        loop_0_reg_247 = loop_reg_991.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state7.read())) {
        x_0_i_reg_226 = x_2_fu_375_p2.read();
    } else if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state5.read())) {
        x_0_i_reg_226 = prod_q0.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state8.read())) {
        add_ln66_reg_969 = add_ln66_fu_602_p2.read();
        icmp_ln66_2_reg_980 = icmp_ln66_2_fu_749_p2.read();
        or_ln66_reg_975 = or_ln66_fu_743_p2.read();
        zext_ln66_cast_reg_964 = zext_ln66_cast_fu_587_p3.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state6.read()) && esl_seteq<1,1,1>(ap_const_lv1_0, icmp_ln85_fu_338_p2.read()))) {
        i_3_reg_943 = i_3_fu_344_p2.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read())) {
        i_reg_897 = i_fu_268_p2.read();
        trunc_ln124_reg_889 = trunc_ln124_fu_258_p1.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read())) {
        j_reg_910 = j_fu_296_p2.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state10.read())) {
        loop_reg_991 = loop_fu_868_p2.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read()) && esl_seteq<1,1,1>(icmp_ln124_fu_262_p2.read(), ap_const_lv1_0))) {
        shl_ln_reg_902 = shl_ln_fu_278_p3.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state6.read()) && esl_seteq<1,1,1>(icmp_ln85_fu_338_p2.read(), ap_const_lv1_1))) {
        temp_addr_4_reg_954 =  (sc_lv<6>) (zext_ln66_15_fu_370_p1.read());
        tmp_17_reg_948 = bitNumber_assign_reg_203.read().range(4, 3);
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read()) && esl_seteq<1,1,1>(ap_const_lv1_0, icmp_ln125_fu_290_p2.read()))) {
        zext_ln127_reg_915 = zext_ln127_fu_311_p1.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state10.read()) && esl_seteq<1,1,1>(ap_const_lv1_0, icmp_ln133_fu_862_p2.read()))) {
        zext_ln134_reg_996 = zext_ln134_fu_874_p1.read();
    }
}

